                "description": "नागरिकता कानून के ख़िलाफ़ प्रदर्शन कर रहे शाहीन बाग़ में नया मोड़ आ गया है. गृह मंत्री अमित शाह ने एक टीवी कार्यक्रम में कहा कि वो इस मामले में चर्चा के लिए तैयार हैं. शनिवार दोपहर शाहीन बाग़ में प्रेस कॉन्फ्रेंस कर कहा गया कि रविवार को अमित शाह से मुलाक़ात के लिए शाहीन बाग के लोग जाएंगे. एक दूसरे धड़े का कहना है कि पूरे देश में शाहीन बाग़ की तर्ज़ पर प्रदर्शन हो रहे हैं, ऐसे में उनके साथ भी चर्चा ज़रूरी है. लेकिन अगर शाहीन बाग़ के सभी लोग अमित शाह से मिलने जाएंगे, तो सवाल ये कि अमित शाह से बातचीत कौन करेगा. इन्हीं सभी सवालों के जवाब तलाशने की कोशिश की बीबीसी संवाददाता सलमान रावी और शूट एडिट साहिबा ख़ान ने.\n\n#ShaheenBagh #AmitShah #CAAProtest #NRC\n\n\nBBC Indian Sportswoman of the Year: अपनी पसंदीदा खिलाड़ी के लिए वोट कीजिए – बीबीसी स्पोर्ट्सवुमन ऑफ़ द इयर अवॉर्ड के लिए शॉर्टलिस्ट हुई पांच महिला खिलाड़ियों के नाम आपके सामने हैं. अब वोट करने की बारी आपकी है. लिंक पर क्लिक कीजिए. मौका सिर्फ़ 17 फ़रवरी तक -https://www.bbc.com/hindi/resources/idt-a6da5349-3698-4f42-9e5b-35513c8c0537\n\nऐसे ही और दिलचस्प वीडियो देखने के लिए चैनल सब्सक्राइब ज़रूर करें-\nhttps://www.youtube.com/channel/UCN7B-QD0Qgn2boVH5Q0pOWg?disable_polymer=true\n\nबीबीसी हिंदी से आप इन सोशल मीडिया चैनल्स पर भी जुड़ सकते हैं-\n\nफ़ेसबुक- https://www.facebook.com/BBCnewsHindi\nट्विटर- https://twitter.com/BBCHindi\nइंस्टाग्राम- https://www.instagram.com/bbchindi/\n\nबीबीसी हिंदी का एंड्रॉयड ऐप डाउनलोड करने के लिए क्लिक करें- https://play.google.com/store/apps/details?id=uk.co.bbc.hindi",
